access rates have changed since August 1:
On August 1, 2020, hh.ru introduced its biggest change yet - it switched to a new model of working with its resume database. In brief, it severely reduced the number of resumes. Now the company is given 1280 resumes per month, ON all managers or 45 resumes per day. Previously 8000 resumes per day were given. The full rates are here https://hhcdn.ru/file/16899324.pdf My terms and conditions will also change accordingly.Now the price for access will be based on the number of resumes you view:
1. If you look at 30 CVs per day:
 - week: 4000 rubles;
 - 2 weeks: 6000 rubles;
 - month: 10000 rubles;
 - 3 months: 25000 rubles.

2. When reviewing 50 resumes per day:
 - week: 5000 rubles;
 - 2 weeks: 8000 rubles;
 - month: 13000 rubles;
 - 3 months: 35000 rubles.

3. When reviewing 100 resumes per day:Week: 6000 rub;Week 2 weeks: 9000 rub;Month: 15000 rub;Month 3 months: 40000 rub.Access to SJ (30 resumes per day):Week: 3500 rub;Week 2 weeks: 6000 rub;Month: 8000 rub;Month 3 months: 22000 rub.\If you buy 2 resources (HH+SJ), you get 10% discount. Payment to bank card or Yandex money
*When you buy 2 or more hh cabins - 10% discount for one week at Superjob 3500 now
